import axios from "axios";
import { SubmissionError } from "redux-form";
const URL = "http://localhost:3001";

export const validateEmail = async email => {
  try {
    const res = await axios.get(`${URL}/validateEmail`, {
      params: { email: email }
    });

    console.logg("show");
  } catch (error) {
    console.log(error);
    throw new SubmissionError({
      error
    });
  }
};
